{{TennisEventInfo|1994|Benson and Hedges Open| | date=10 – 17 January | edition=27th | category=[[ATP World Series|World Series]] | draw=32S / 16D | prize_money=$288,750 | surface=Hard / outdoor | location=[[Auckland]], New Zealand | venue=[[ASB Tennis Centre]] | champs={{flagicon|SWE}} [[Magnus Gustafsson]] <ref name="ms">{{cite web|title=1994 Auckland Men's Singles draw|url=http://www.atpworldtour.com/en/scores/archive/auckland/301/1994/draws?matchType=singles|publisher=[[Association of Tennis Professionals]] (ATP)}}</ref> | champd={{flagicon|USA}} [[Patrick McEnroe]] / {{flagicon|USA}} [[Jared Palmer]] <ref name="md">{{cite web|title=1994 Auckland Men's Doubles draw|url=http://www.atpworldtour.com/en/scores/archive/auckland/301/1994/draws?matchType=doubles|publisher=[[Association of Tennis Professionals]] (ATP)}}</ref> | main_name = Heineken Open (tennis){{!}} ATP Auckland Open }}
The '''1994 [[Heineken Open (tennis)|Benson and Hedges Open]]''' was a men's professional [[tennis]] tournament held in [[Auckland]], New Zealand. The event was part of the [[ATP World Series|World Series]] of the [[1994 ATP Tour]] and was held from 10 January through 17 January 1994. First-seeded [[Magnus Gustafsson]] won the singles title.
==Winners==
===Men's Singles=== {{main article|1994 Benson and Hedges Open – Singles}} {{flagicon|SWE}} '''[[Magnus Gustafsson]]''' defeated {{flagicon|USA}} [[Patrick McEnroe]] 6–4, 6–0 * It was Gustafsson's 1st title of the year and the 6th of his career.
===Men's Doubles=== {{main article|1994 Benson and Hedges Open – Doubles}} {{flagicon|USA}} '''[[Patrick McEnroe]]''' / {{flagicon|USA}} '''[[Jared Palmer]]''' defeated {{flagicon|CAN}} [[Grant Connell]] / {{flagicon|USA}} [[Patrick Galbraith]] 6–2, 4–6, 6–4 * It was McEnroe's 1st title of the year and the 13th of his career. It was Palmer's 1st title of the year and the 3rd of his career.
