{{coord|33.5479|-81.7227|display=title|type:landmark}}
The '''Aiken Thoroughbred Racing Hall of Fame and Museum''' was established in 1977 as a tribute to the famous [[flat racing]] and [[steeplechase (horse racing)|steeplechase]] [[Thoroughbred]] horses that trained in [[Aiken, South Carolina]].

The museum was a project of the local [[United States Junior Chamber|Jaycees]], aided by [[Thoroughbred]] [[horse racing]] expert [[Whitney Tower]], horse racing editor for ''[[Sports Illustrated]]'' and Vice President of the [[National Museum of Racing and Hall of Fame|National Racing Museum]] and Chair of its Hall of Fame.<ref name="MoreThan">Stephanie Turner, [http://www.aikenstandard.com/article/20150311/AIK0401/150319867 "Thoroughbred museum: More than a Hall of Fame exhibit"], ''[[Aiken Standard]]'', March 11, 2015.</ref>

The museum is located on the grounds of Hopelands Gardens, the former home of [[Charles Oliver Iselin]] and [[Hope Goddard Iselin]] that is now owned by the City of Aiken. The museum occupies the Iselins' former carriage house and stables.<ref>Rob Pavey, [http://chronicle.augusta.com/news/aiken/2012-03-31/equestrian-legacy-celebrated-aiken-thoroughbred-hall-fame-and-museum "Equestrian legacy celebrated at Aiken Thoroughbred Hall of Fame and Museum"], ''[[The Augusta Chronicle]]'', March 31, 2012.</ref>  The Hall of Fame commemorates 40 [[Eclipse Award]]-winning horses that trained in Aiken; the museum also includes a variety of other exhibits.<ref name="MoreThan"/>

