{{Infobox cricket ground | ground_name = BAA Ground | nickname = | country = Burma | image = BAA Ground.jpg | location = [[Rangoon]], [[Burma]] | establishment = 1927 (first recorded match) | seating_capacity = | end1 = | end2 = | year1 = | club1 = | date = 8 October | year = 2011 | source = https://cricketarchive.com/Archive/Grounds/44/250.html Ground profile }}
The '''BAA Ground''' ('''Burma Athletic Association Ground''') was a [[cricket]] ground in [[Rangoon]], [[Burma]] (today Yangon, Myanmar). The first and only recorded match on the ground came in 1927 when [[Burma national cricket team|Burma]] played its only [[first-class cricket|first-class]] match against the [[Marylebone Cricket Club cricket team in India and Ceylon in 1926–27|touring Marylebone Cricket Club]].<ref>{{cite web |subscription=yes |url=https://cricketarchive.com/Archive/Grounds/44/250_f.html|title=First-Class Matches played on BAA Ground, Rangoon|publisher=CricketArchive|accessdate=8 October 2011}}</ref> The match ended in a heavy defeat for Burma.<ref>{{cite web |subscription=yes |url=https://cricketarchive.com/Archive/Scorecards/12/12171.html|title=Burma v Marylebone Cricket Club, 1926/27|publisher=CricketArchive|accessdate=8 October 2011}}</ref> Cricket in Burma (which was at the time administered as part of the [[British Raj]]) was a mainly British affair, with the game played by British officials. With Burmese independence in 1948, cricket became largely extinct in the country.
