'''Kitson Kapiriel''' (born December 10, 1993) is a [[sprint (running)|sprinter]] from the [[Federated States of Micronesia]]. He competed at the [[2016 Summer Olympics]] in the [[Athletics at the 2016 Summer Olympics – Men's 100 metres|men's 100 metres]] race; his time of 11.42 seconds in the preliminary round did not qualify him for the first round.<ref>{{cite web|title=Kapririel Kitson |url=https://www.rio2016.com/en/athlete/kitson-kapiriel |website=Rio 2016 |accessdate=August 22, 2016 |archiveurl=https://web.archive.org/web/20160816063617/https://www.rio2016.com/en/athlete/kitson-kapiriel |archivedate=August 16, 2016 |deadurl=yes |df= }}</ref><ref>{{cite web|title=Men's 100m - Standings |url=https://www.rio2016.com/en/athletics-standings-at-mens-100m |website=Rio 2016 |accessdate=August 22, 2016 |archiveurl=https://web.archive.org/web/20160822033050/https://www.rio2016.com/en/athletics-standings-at-mens-100m |archivedate=August 22, 2016 |deadurl=yes |df= }}</ref>

