'''Lindel Hodge''' (born 5 April 1959, in [[Road Town]], [[Tortola]]) is a [[sprint (running)|sprinter]] from the [[British Virgin Islands]].
Hodge was part of the first ever team to represent [[British Virgin Islands]] at the [[Summer Olympics]] when he competed in the [[1984 Summer Olympics]], he entered the [[Athletics at the 1984 Summer Olympics – Men's 100 metres|200 metres]] and in his heat he ran a time of 22.28 seconds and finished 5th out of eight runners so didn't qualify for the next round, he also entered the [[Athletics at the 1984 Summer Olympics – Men's 4 × 400 metres relay|4x400 metres relay]] they finished 6th in the heat so didn't qualify for the next round. Four years later he was at the [[1988 Summer Olympics]] and this time he ran in the [[Athletics at the 1988 Summer Olympics – Men's 100 metres|100 metres]] and [[Athletics at the 1988 Summer Olympics – Men's 200 metres|200 metres]] in the 100 metres he ran in a time of 10.79 seconds and finished 6th in his heat and the 200 metres he finished 5th so didn't qualify for the next round in either event.<ref>[https://www.sports-reference.com/olympics/athletes/ho/lindel-hodge-1.html Sports Reference Profile]</ref>
