The following is a list of [[women's international rugby union]] matches with non-test status.
The list includes: *Matches involving designated national "A" teams, *Matches of doubtful status, *Matches between full international sides and non-national XVs, and *Other games of note.
It is included as some nations have awarded full caps for these games and may include them as full internationals in their own records. In addition these games act as an indicator of the relative strength of some of the smaller nations, and the strength in depth of the larger.
==1990==
{{wrugbybox | test# = -| date = 1990-10-21| nohome = {{ruw-rt|Catalonia}}<ref>'''Status of Catalonia'''
The status of games played by Catalonia - especially the games in 1990 and 1995 against Wales and Germany respectively - appear to have been treated as if there were internationals by both opponents at the time. However the status of these games have changed following two retrospective rulings.
First, in 2009 Wales (via email correspondence confirmed by their website) changed the designation of their team to only a "Wales XV" and therefore not an international. This may have been influenced by a 2008 French court ruling (see [http://www.fira-aer-rugby.com/medias/090105_NH_COM_Flash_Info_97_EN.pdf])that the Catalan Rugby Union was not a national union and therefore could not be a member of Rugby Europe (known at the time as FIRA).
As this ruling was retrospective the game between Catalonia and Germany in 1995 also cannot now be considered a game between teams from two nations unions.''</ref> | score = 4-0| noaway = {{ruw|Wales|name=Wales XV}} | stadium = [[Barcelona]]| code = -/-/-|}}
