'''Nicole Müller''' (born 14 November 1994) was a German group [[rhythmic gymnast]]. She represented her nation at international competitions.
She participated at the [[2012 Summer Olympics]] in London.<ref>{{cite Sports-Reference |url=https://www.sports-reference.com/olympics/athletes/mu/nicole-muller-2.html}}</ref> She also competed at world championships, including at the [[2011 World Rhythmic Gymnastics Championships]].<ref>{{cite web |title=2011 World Rhythmic Gymnastics Championships athletes – Nicole Mueller |url=http://gym.longinestiming.com/File/00000A010100FFFFFFFFFFFFFFFFFF02 |publisher=Longinestiming.com |date= |accessdate=27 January 2016}}</ref>
