4 = ? | caps5 = ? | goals1 = ? | goals2 = 0 | goals3 = ? | goals4 = ? | goals5 = ? | nationalyears1 = 1941–1954 | nationalteam1 = [[Chile national football team|Chile]] | nationalcaps1 = 52 | nationalgoals1 = 0 | pcupdate = September 2008}}
'''Serjio Roberto Livingstone Pohlhammer''' (26 March 1920 – 11 September 2012), later simply known as '''Sergio Livingstone''', was a [[Chile]]an [[Goalkeeper (association football)|goalkeeper]], who later became a well regarded journalist. He was nicknamed "El Sapo" for his typical posture in the goal mouth. From 1938–59 he played primarily for [[Club Deportivo Universidad Católica|CD Universidad Católica]] in Santiago. With [[Chilean national football team|Chile]] he took part in seven [[Copa América]] and one [[FIFA World Cup]].
==Career== Serjio (later Sergio) Livingstone's family hailed from [[Scotland]]. His father John, who played for [[Santiago National|Santiago National FC]], was a pioneer of the game in Chile. Livingstone originally joined [[Unión Española]]. He abandoned football to study law at the [[Pontificia Universidad Católica de Chile]]. Soon he acquainted himself with the university's football team, and from 1938 he began to establish himself as the goalkeeper of [[Club Deportivo Universidad Católica|CD Universidad Católica]]. [[File:Sergio Livingstone - Racing - 1943.jpg|thumb|upright|left|Livingstone wearing his Racing Club jersey]] He debuted in the [[Chilean national football team|national team]] at the [[1941 South American Championship]] which took place in Chile, winning 5–0 against [[Ecuador]]. By the end of the tournament Chile ended third, and Livingstone was considered the best player of the tournament. Altogether, Livingstone played between 1941 and 1954 in 52 matches for Chile,<ref>Roberto Mamrud. [http://www.rsssf.com/miscellaneous/chil-recintlp.html Chilean Record International Players] 19 February 2010, RSSSF</ref> which made him the country's record international until 1962, participating in five more South American Championships, totaling 34 matches in this competition, which remains record. He also took part in the [[1950 FIFA World Cup|FIFA World Cup 1950]] in Brazil, where Chile exited after the first group phase. {{Citation needed|date=September 2012}}
At club level he spent 1943 in Argentina playing 30 matches for [[Racing Club de Avellaneda|Racing Club]]. He cut short his time in [[Argentina]] for sentimental reasons and rejoined Católica in 1944, winning the national championships of 1949 and 1954. After the second title the club had the misfortune to be relegated in the season immediately thereafter, but managed to return to the first division as quickly. After a brief spell on loan in 1957 with [[CSD Colo-Colo|Colo-Colo]] he once more returned to Universidad Católica where he finished his career in 1959. Following his football career, he became a well-known sports journalist and television personality with [[Televisión Nacional de Chile]], where he remained until his death (more than 60 years).<ref>{{Cite news|url=http://www.emol.com/noticias/magazine/2012/09/11/560008/sergio-livingstone-en-la-tv-y-los-medios.html|title=Sergio Livingstone: El ex futbolista que llegó a lo más alto de la TV y el periodismo deportivo {{!}} Emol.com|last=S.A.P.|first=El Mercurio|date=2012-09-11|work=Emol|access-date=2018-08-31|language=es-LA}}</ref>
==Legacy== In 2009, a [https://web.archive.org/web/20110622062731/http://www.lanacion.cl/prontus_noticias_v2/site/artic/20090416/pags/20090416220023.html street] in the district of [[Independencia, Chile|Independencia]] in Santiago was named for Livingstone.
